import React, { useState } from "react";
import { Scrollbars } from "react-custom-scrollbars";
import Slider from "./Slider";

function Profile() {
  const images = [
    "./images/1.png",
    "./images/2.png",
    "./images/3.png",
    "./images/4.png",
  ];

  const [items] = useState([
    { title: "GraphQL changed the way we create software", id: 0 },
    { title: "Learn about GraphQL language for free in the browser", id: 1 },
    {
      title:
        "Learn how to be a lead frontend engineer with GraphQL-driven React and Apollo applications",
      id: 2,
    },
  ]);

  ///
  ///
  ///
  return (
    <>
      <Slider slides={images} />
    </>
  );
}

export default Profile;
